import React from 'react'
//import "./active.css"

const Active = props => (
    <div className="card">
        <p align={"justify"}>

         <strong>Project name:</strong> {props.name}
        </p>

        <p align={"justify"}>
            <strong> Curator:</strong> {props.curs}

        </p>

        <p align={"justify"}>

              <strong>  Отработанные часы:</strong> {props.time}

        </p>
            <br/>

    </div>
)


export default Active
